import React from 'react';
import './App.scss';
import Icon from "./components/icon/Icon";
import InputField from "./components/input-field/InputField";
import Button from "./components/button/Button";

const App: React.FC = () => {
    return (
        <div className="main">
            <div className="container d-flex align-items-center justify-content-center h-100">
                <div className="d-flex flex-column align-items-center">
                    <div className="logo mb-5"/>
                    <form className="form" onSubmit={this.submitHan}>
                        <InputField type={'text'} name={'username'} placeholder={'Username'}>
                            <Icon name={'username'} color={'#CCC'} width={14} height={16}/>
                        </InputField>

                        <InputField type={'password'} name={'password'} placeholder={'Password'}>
                            <Icon name={'password'} color={'#CCC'} width={14} height={16}/>
                        </InputField>

                        <Button title={'Log in'} extraClasses="w-100" style="success" type="submit"/>
                    </form>
                </div>
            </div>
        </div>
    );
};

export default App;
